// src/components/FacultyList.js
import React from 'react';
import { Link } from 'react-router-dom';

const FacultyList = ({ faculties, onDelete }) => {
  return (
    <div style={{ margin: '20px' }}>
      <h2>Faculty Members</h2>
      <ul style={{ listStyleType: 'none', padding: 0 }}>
        {faculties.map(faculty => (
          <li
            key={faculty._id}
            style={{
              border: '1px solid #ccc',
              padding: '15px',
              marginBottom: '10px',
              borderRadius: '5px'
            }}
          >
            <h3>{faculty.name}</h3>
            <p><strong>Department:</strong> {faculty.department}</p>
            <p><strong>Email:</strong> {faculty.email}</p>
            <p><strong>Phone:</strong> {faculty.phone || 'N/A'}</p>
            <p><strong>Max Hours/Week:</strong> {faculty.maxHoursPerWeek}</p>
            <p><strong>Qualifications:</strong> {faculty.qualifications && faculty.qualifications.map(q => q.name).join(', ')}</p>
            <p><strong>Unavailability:</strong> {faculty.unavailability && faculty.unavailability.join(', ')}</p>

            <div>
              <Link to={`/faculties/edit/${faculty._id}`}>
                <button style={{ marginRight: '10px' }}>Edit</button>
              </Link>
              <button onClick={() => onDelete(faculty._id)}>Delete</button>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default FacultyList;
